import { Pagination } from 'react-bootstrap';

const TablePagination = ({ resPerPage, totalRes }) => {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(totalRes / resPerPage); i++) {
    pageNumbers.push(i);
  }
};

export default TablePagination;
